// Dashboard.js
import React from 'react';
import { useClerk } from '@clerk/clerk-react';
import './style1.css';
function Dashboard() {
    return (
      <div>
        <nav className="navbar">
          <h1>New Mom Support</h1>
        </nav>

        <div className="content">
          <h2>Welcome to your Dashboard</h2>
          <div className="cards">
            <div className="card" onClick={() => window.location.href = '/tutors'}>
              <h3>Find Tutors</h3>
              <p>Connect with qualified tutors for your children's education needs.</p>
            </div>
            <div className="card" onClick={() => window.location.href = '/activities'}>
              <h3>Kid-Friendly Activities</h3>
              <p>Discover fun and educational activities for your children.</p>
            </div>
            <div className="card" onClick={() => window.location.href = '/doctors'}>
              <h3>Healthcare Providers</h3>
              <p>Find trusted doctors and healthcare professionals.</p>
            </div>
          </div>
        </div>
      </div>
    );
  }

export default Dashboard;
